import './App.css';

import Header from "./pages/include/header.js";
import Footer from "./pages/include/footer.js";
import RightMenu from "./pages/include/right_menu.js";


const App = () => {


  return (

    <div className="App">
      <Header />
      <div className="banner-sec">
          <div className="banner-tit">타이틀입니다.</div>
      </div>
      <div className="wrap">
          <body className="app-body">
            <div className="cnt_wrap">
                <div className="cnt">
                  <div className="cnt_tit">타이틀</div>
                  <div className="tit_line"></div>
                  <div className="cnt_sub_tit">서브타이틀</div>
                </div>
            </div>
            <RightMenu />
          </body>
      </div>


      <Footer />

    </div>
  );
};

export default App;
